import React, { Component } from 'react';
//import { Jumbotron } from 'react-bootstrap';
import homePagePhoto from '../images/homepage-photo.png';
import { Jumbotron } from 'react-bootstrap';

class HomePage extends Component {
    state = {}
    render() {
        return (
            <img
                width="75%"
                src={homePagePhoto}
                alt="Savings Bonds"
            />
        )
    }
}

export default HomePage;
